import React from 'react';
import pro from "../../Image/pro.gif";
import "./Myabout.css";

const Myabout = () => {
  return (
    <section className='about'>

    <div className="logo">
        <img src={pro} alt="programmer" />
    </div>
    <div className="about-me">

    </div>

    </section>
  )
}

export default Myabout
